import { BrowserRouter as Routes, Route } from "react-router-dom";
import { Navbar } from "./components/Navbar";
import { Main } from "./components/Main";

const AppRoutes = () => {
  return (
    <>
      <Navbar />
      <Routes>
        <Route exact path="/" element={<Main/>}/>
      </Routes>
    </>
  );
};

export default AppRoutes;
